import React from "react";
import AppRoutes from "./routes";
import Navbar from "./components/common/Navbar";
import { AuthProvider } from "./context/AuthContext";

function App() {
  return (
    <AuthProvider>
         <Navbar />
      <AppRoutes />
    </AuthProvider>
  );
}

export default App;
